import React from 'react';
import './App.css';

const HomePage = () => {
  // Пример данных (в реальном приложении будут приходить из API)
  const user = {
    name: 'Имя юзера',
    email: 'почта@gmail.com',
    avatar: null
  };

  const recentSummaries = [
    {
      id: 1,
      title: 'Конспект файла: OOП.docx',
      preview: 'Конечно, вот подробный и структурированный конспект текста: --- Конспект урока: Основы объектно...',
      date: '23.10.2025',
      compression: '335% сжатия',
      fileName: 'OOП.docx'
    }
    // Добавьте больше конспектов по необходимости
  ];

  const getInitials = (name) => {
    return name.split(' ').map(word => word[0]).join('').toUpperCase();
  };

  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      // Обработка загрузки файла
      console.log('File selected:', file);
      // Здесь будет логика обработки файла
    }
  };

  return (
    <div className="homepage">
      <div className="homepage-container">
        <div className="homepage-content">
          {/* Основной контент */}
          <div className="main-content">
            {/* Баннер */}
            <div className="hero-banner">
              <h1>Искусственный интеллект напишет за вас конспект</h1>
              <p>Быстрое и качественное создание конспектов из любых текстов и документов</p>
            </div>

            {/* Создание конспекта */}
            <div className="create-summary">
              <h2>Создайте новый конспект</h2>
              
              <div className="example-text">
                <p><strong>Пример:</strong> Напиши конспект по этой презентации</p>
                <div className="example-placeholder">
                  <div className="placeholder-line"></div>
                  <div className="placeholder-line"></div>
                </div>
              </div>

              <div 
                className="file-upload-section"
                onClick={() => document.getElementById('file-upload').click()}
              >
                <p>Загрузить файл (PDF, DOCX, TXT)</p>
                <div className="file-types">Поддерживаемые форматы: PDF, DOCX, TXT</div>
                <input
                  id="file-upload"
                  type="file"
                  accept=".pdf,.docx,.txt"
                  onChange={handleFileUpload}
                  style={{ display: 'none' }}
                />
              </div>
            </div>
          </div>

          {/* Боковая панель */}
          <div className="sidebar">
            {/* Профиль */}
            <div className="sidebar-profile">
              <div className="profile-header-sidebar">
                <div className="profile-avatar-sidebar">
                  {getInitials(user.name)}
                </div>
                <div className="profile-info-sidebar">
                  <h3>{user.name}</h3>
                  <p>{user.email}</p>
                </div>
              </div>
            </div>

            {/* Недавние конспекты */}
            <div className="recent-summaries-sidebar">
              <h3>Недавние конспекты</h3>
              
              {recentSummaries.length > 0 ? (
                recentSummaries.map(summary => (
                  <div key={summary.id} className="recent-item">
                    <div className="recent-item-header">
                      <h4 className="recent-item-title">{summary.title}</h4>
                      <span className="recent-item-meta">{summary.date}</span>
                    </div>
                    <p className="recent-item-preview">{summary.preview}</p>
                    <div className="recent-item-stats">
                      <span>{summary.fileName}</span>
                      <span className="compression-badge">{summary.compression}</span>
                    </div>
                  </div>
                ))
              ) : (
                <p className="empty-state">Пока нет созданных конспектов</p>
              )}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
